Everyone is different, and what works for one person may not work for you. Before changing to an anti-mucus diet, be sure to talk with your doctor. Look for foods that may reduce mucus production. Fruits and vegetables are rich in antioxidants. In fact, antioxidants help support your bodyâ€™s ability to stay healthy and to heal if you become ill. Vitamin C, for example, has anti-inflammatory properties and may help open the airways and reduce wheezing.
Some Fruits and Vegetables may cause increased gas and bloating, such as broccoli. If certain foods cause more gas, your doctor may advise you to limit how much of those foods you eat.

Think Anti-Inflammatory for Anti-Mucus

Olive oil is a good source of unsaturated fat, and it contains oleocanthal, which may produce effects similar to anti-inflammatory medications. Consider cooking with olive oil instead of butter or margarine.
Warm fluids help break-up mucus, flush your system of toxins and promote hydration. Soups and teas arenâ€™t just for when you have a cold or illness. Clear broth soups, meaning soups without cream or dairy, and warm decaffeinated tea can loosen mucus and provide added hydration.
Certain fish, seeds, nuts and more contain essential fatty acids. Omega-3 fatty acids can help reduce inflammation and phlegm. Sources of omega-3s include:
* Mackerel
* Salmon
* Herring
* Tuna
* Lake Trout
* Walnuts
* Flaxseeds
* Pumpkin Seeds
